function getAutocompleteArray(lang) {
    const indexedLangs = {
	'alb':1,
	'amh':1,
	'ara':1,
	'azj':1,
	'bos':1,
	'fin':1,
	'gre':1,
	'hrv':1,
	'kmr':1,
	'per':1,
	'pus':1,
	'rus':1,
	'sdh':1,
	'som':1,
	'spa':1,
	'srp':1,
	'swe':1,
	'tir':1,
	'tur':1,
	'ukr':1
    };

    if(!indexedLangs.hasOwnProperty(lang)) {
	return [];
    }
    
    if(langToIndexArray.hasOwnProperty(lang)) {
	return langToIndexArray[lang];
    } else {
	return langToIndexArray['default'];
    }
}


